(11, 18, 'Sidi Ouadhah Waterfall', 'Sidi Ouadhah Waterfall is a serene and picturesque natural site located in the heart of Aïn Defla Province, Algeria. Nestled among rocky cliffs and lush vegetation, the waterfall offers a peaceful escape with its clear flowing waters and surrounding scenic beauty. It is a favorite spot for nature lovers, hikers, and locals seeking tranquility away from urban life.', 'Algeria', 'Tiaret', 'El Abadia', NULL, 35.29316073, 1.26512988, NULL, , '2025-04-29 23:14:13', '2025-04-29 23:18:25', '7.9/10');
INSERT INTO `places` (`id`, `category_id`, `name`, `description`, `country`, `province`, `municipality`, `neighborhood`, `latitude`, `longitude`, `map_link`, `image_picture`, `created_at`, `updated_at`, `rate`) VALUES
(12, 14, 'Radar Forest ', 'Radar Forest is a tranquil woodland area located in Tiaret Province, Algeria, known for its dense pine trees, fresh mountain air, and peaceful walking trails. It\'s a favored spot for hikers, ', 'Algeria', 'Tiaret', 'Tiaret', NULL, 35.39361876, 1.30433875, NULL, , '2025-04-29 23:24:12', '2025-04-29 23:24:12', '5.1/10');
INSERT INTO `places` (`id`, `category_id`, `name`, `description`, `country`, `province`, `municipality`, `neighborhood`, `latitude`, `longitude`, `map_link`, `image_picture`, `created_at`, `updated_at`, `rate`) VALUES
(13, 16, 'Jidar area', 'Jidar is a significant archaeological site located near Frenda in Tiaret Province, Algeria. It is renowned for its ancient stone structures known as the Jedars, which are large sepulchral monuments dating from the 5th to 7th centuries CE. These monuments, built atop hills, consist of square or rectangular podiums surmounted by pyramidal structures, reflecting the funerary architecture of the time.​', 'Algeria', 'Tiaret', 'Frenda', NULL, 35.11340552, 1.21245501, NULL, , '2025-04-29 23:29:25', '2025-04-29 23:29:25', '8.2/10');
INSERT INTO `places` (`id`, `category_id`, `name`, `description`, `country`, `province`, `municipality`, `neighborhood`, `latitude`, `longitude`, `map_link`, `image_picture`, `created_at`, `updated_at`, `rate`) VALUES
(15, 18, 'National Stud Farm of Chaouchaoua', 'The National Stud Farm of Chaouchaoua, located in Tiaret, Algeria, is one of the oldest and most prestigious horse breeding centers in North Africa. Founded in 1874, it is renowned for preserving and improving purebred Arabian and Barb horses. The center serves as a hub for equine training, breeding, and education, attracting visitors, professionals, and horse lovers alike.', 'Algeria', 'Tiaret', 'Tiaret', NULL, 35.39951001, 1.36617507, NULL, , '2025-04-29 23:41:21', '2025-04-29 23:41:21', '9.3/10');
INSERT INTO `places` (`id`, `category_id`, `name`, `description`, `country`, `province`, `municipality`, `neighborhood`, `latitude`, `longitude`, `map_link`, `image_picture`, `created_at`, `updated_at`, `rate`) VALUES
(16, 16, 'Ibn Khaldun Cave', 'Ibn Khaldun Cave is a historic and cultural landmark located in Taoughazout village, near Frenda in Tiaret Province, Algeria. It is famously known as the retreat where the renowned Arab historian and philosopher Ibn Khaldun lived between 1375 and 1379. During his stay, he wrote the Muqaddimah, one of the most influential works in the fields of sociology and history.', 'Algeria', 'Tiaret', 'Tiaret', NULL, 35.01935385, 1.06675217, NULL, , '2025-04-29 23:50:28', '2025-04-29 23:50:28', '6.9/10');
INSERT INTO `places` (`id`, `category_id`, `name`, `description`, `country`, `province`, `municipality`, `neighborhood`, `latitude`, `longitude`, `map_link`, `image_picture`, `created_at`, `updated_at`, `rate`) VALUES
(17, 13, ' Ain Jnan Tiaret', 'Ain Jnan Tiarrt (or Aïn Jnan Tiarrt) is a small village or rural area located in Morocco, likely in the Souss-Massa region or near Agadir. The name translates to \"Spring of the Gardens of Tiarrt\" in English, referring to natural springs and agricultural lands in the area.', 'Algeria', 'Tiaret', 'Tiaret', '15 rue Emir Abd El Kader, Tiaret', 35.37688220, 1.31443433, NULL, , '2025-05-12 16:50:04', '2025-05-12 16:50:04', '5/10');

